import Link from "next/link";

const linkStyle = {
  marginRight: 15
};
function returnArtists() {
  return [
    { id: "maxlabor", artist: "maxlabor" },
    { id: "kiptok", artist: "kiptok" },
    { id: "joy", artist: "joy" }
  ];
}

const Files = () => (
  <div>
    {/* <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link> */}

    <ul>
      {returnArtists().map(artiste => (
        <li key={artiste.id}>
          <Link href="/[id]" as={`/${artiste.id}`}>
            <a>{artiste.artist}</a>
          </Link>
        </li>
      ))}
    </ul>

    <style jsx>{`
      h1,
      a {
        font-family: "Arial";
      }

      ul {
        padding: 0;
      }

      li {
        list-style: none;
        margin: 5px 0;
      }

      a {
        text-decoration: none;
        color: blue;
      }

      a:hover {
        opacity: 0.6;
      }
    `}</style>
  </div>
);

export default Files;
